import React from 'react';
export default function Contact() {
  return (
    <div className="page-content">
      <h2>Contact Us</h2>
      <p>Email: support@onedoctorapp.com</p>
      <p>Phone: +1 (888) 555-1212</p>
      <p>Address: 123 Wellness Blvd, HealthTech City, USA</p>
    </div>
  );
}
